import { useEffect, useState } from "react";
import moment from "moment-timezone";
import Moment from "react-moment";

function App() {
  const [time, setTime] = useState(true);

  useEffect(() => {
    setInterval(() => setTime(!time), 1000);
  }, [time]);

  return (
    <Moment>
      <h1>{moment().format("LTS")}</h1>
    </Moment>
  );
}

export default App;
